import React, { useState } from 'react';
import { GitHubUser, GitHubRepo, getUserRepos } from '../services/githubApi';
import { useInfiniteQuery, QueryFunctionContext } from '@tanstack/react-query';
import RepoList from './RepoList';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemAvatar from '@mui/material/ListItemAvatar';
import Avatar from '@mui/material/Avatar';
import ListItemText from '@mui/material/ListItemText';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
import ExpandLessIcon from '@mui/icons-material/ExpandLess';

const PER_PAGE = 9;

interface UserListProps {
  users: GitHubUser[];
}

const UserList: React.FC<UserListProps> = ({ users }) => {
  return (
    <div>
      <Typography variant="h6" gutterBottom>
        Showing users
      </Typography>
      {users.length === 0 && (
        <Typography variant="body2" color="textSecondary">
          No users found.
        </Typography>
      )}
      <List>
        {users.map((user) => (
          <UserItem key={user.id} user={user} />
        ))}
      </List>
    </div>
  );
};

interface UserItemProps {
  user: GitHubUser;
}

/**
 * Komponen UserItem: menampilkan baris user yang dapat diklik untuk expand/collapse repos.
 * Menggunakan useInfiniteQuery untuk eager load repos.
 */
const UserItem: React.FC<UserItemProps> = ({ user }) => {
  const [expanded, setExpanded] = useState<boolean>(false);
  const [displayedPages, setDisplayedPages] = useState<number>(1);

  const {
    data: repoData,
    fetchNextPage,
    hasNextPage,
    isFetchingNextPage,
    isLoading,
    isError,
    error,
  } = useInfiniteQuery<GitHubRepo[], Error, { pages: GitHubRepo[]; pageParams: number[] }, [string, string], number>({
    queryKey: ['userRepos', user.login],
    initialPageParam: 1,
    queryFn: (context: QueryFunctionContext<[string, string], number>) => {
      const pageParam =
        typeof context.pageParam === 'number' ? context.pageParam : 1;
      return getUserRepos(user.login, pageParam, PER_PAGE);
    },
    enabled: true, // eager load repos segera
    getNextPageParam: (lastPage, allPages) => {
      return lastPage.length === PER_PAGE ? allPages.length + 1 : undefined;
    },
    staleTime: 1000 * 60 * 5,
  });

  // Ambil repos per halaman yang sudah di-fetch
  const pages = repoData ? repoData.pages : [];
  // Tampilkan repos dari halaman 1 sampai displayedPages
  const displayedRepos: GitHubRepo[] = pages.slice(0, displayedPages).flat();

  const handleToggleExpand = () => {
    setExpanded((prev) => !prev);
  };

  const handleLoadMore = async () => {
    // Jika halaman yang sudah di-load sama dengan yang ditampilkan dan ada halaman selanjutnya
    if (repoData && displayedPages === repoData.pages.length && hasNextPage) {
      await fetchNextPage();
    }
    setDisplayedPages((prev) => prev + 1);
  };

  const handleShowLess = () => {
    setDisplayedPages(1);
  };

  return (
    <>
      <ListItem disablePadding>
        <ListItemButton onClick={handleToggleExpand}>
          <ListItemAvatar>
            <Avatar alt={user.login} src={user.avatar_url} />
          </ListItemAvatar>
          <ListItemText primary={user.login} />
          {expanded ? <ExpandLessIcon /> : <ExpandMoreIcon />}
        </ListItemButton>
      </ListItem>
      {expanded && (
        <div style={{ marginLeft: 48 }}>
          {isLoading && <Typography>Loading repos...</Typography>}
          {isError && (
            <Typography color="error">{(error as Error).message}</Typography>
          )}
          {!isLoading && !isError && (
            <>
              <RepoList
                repos={displayedRepos}
                username={user.login}
                onLoadMore={handleLoadMore}
                // Tampilkan tombol "Load More" jika masih ada halaman yang belum ditampilkan
                hasMore={
                  hasNextPage || (repoData ? displayedPages < repoData.pages.length : false)
                }
                isLoadingMore={isFetchingNextPage}
              />
              {displayedPages > 1 && (
                <Button
                variant="text"
                onClick={handleShowLess}
                sx={{ marginTop: 1, justifyContent: 'center' }}
                >
                    Show Less
                </Button>
              )}
            </>
          )}
        </div>
      )}
    </>
  );
};

export default UserList;
